local Players = game:GetService("Players")
local StarterGui = game:GetService("StarterGui")
local lp = Players.LocalPlayer

local ScreenGui = Instance.new("ScreenGui")
ScreenGui.Parent = game.CoreGui
ScreenGui.ResetOnSpawn = false

local Frame = Instance.new("Frame")
Frame.Size = UDim2.new(0,300,0,160)
Frame.Position = UDim2.new(0.5,-150,0.5,-80)
Frame.BackgroundColor3 = Color3.fromRGB(30,30,30)
Frame.BorderSizePixel = 0
Frame.Parent = ScreenGui

local UICorner = Instance.new("UICorner",Frame)

local Title = Instance.new("TextLabel")
Title.Size = UDim2.new(1,0,0,40)
Title.BackgroundTransparency = 1
Title.Font = Enum.Font.GothamBold
Title.Text = "Scripts Maintenance"
Title.TextScaled = true
Title.TextColor3 = Color3.fromRGB(255,255,255)
Title.Parent = Frame

local Desc = Instance.new("TextLabel")
Desc.Size = UDim2.new(1,-20,0,40)
Desc.Position = UDim2.new(0,10,0,40)
Desc.BackgroundTransparency = 1
Desc.Font = Enum.Font.Gotham
Desc.TextWrapped = true
Desc.Text = "Pls join our Discord to get more information."
Desc.TextColor3 = Color3.fromRGB(230,230,230)
Desc.Parent = Frame

local Btn = Instance.new("TextButton")
Btn.Size = UDim2.new(0.9,0,0,35)
Btn.Position = UDim2.new(0.05,0,0,90)
Btn.BackgroundColor3 = Color3.fromRGB(0,120,255)
Btn.Font = Enum.Font.GothamBold
Btn.TextSize = 16
Btn.Text = "Join Discord"
Btn.TextColor3 = Color3.fromRGB(255,255,255)
Btn.Parent = Frame
Instance.new("UICorner",Btn)

local Close = Instance.new("TextButton")
Close.Size = UDim2.new(0,25,0,25)
Close.Position = UDim2.new(1,-30,0,5)
Close.BackgroundTransparency = 1
Close.Font = Enum.Font.GothamBold
Close.Text = "X"
Close.TextColor3 = Color3.fromRGB(255,100,100)
Close.TextSize = 16
Close.Parent = Frame

local discord = "https://discord.gg/hyjT9P3VYV" 

Btn.MouseButton1Click:Connect(function()
    setclipboard(discord)
    StarterGui:SetCore("SendNotification",{
        Title="Copied!",
        Text="Discord link copied to clipboard",
        Duration=3
    })
end)

Close.MouseButton1Click:Connect(function()
    ScreenGui:Destroy()
    StarterGui:SetCore("SendNotification",{
        Title="Closed",
        Text="GUI closed",
        Duration=3
    })
end)
